import React, { Component } from 'react';
import './Widget.css';

class Wid3 extends Component {
        state = {
            post : {}
          }

    componentDidMount(){
        fetch(this.props.url)
        .then((response) => {
          return response.json()
        })
        .then((result) => {
          this.setState({post: result})
        })
      }

    render(){
        console.log(this.state.post)
        return(
            <div className="Widget">
            </div>
        )
    }
}

export default Wid3;
